import React, { Component } from "react"
import Header from "components/Header/Header.jsx";
import classNames from "classnames";
// import HeaderLinks from "components/Header/HeaderLinks.jsx";
import Parallax from "components/Parallax/Parallax.jsx";
import ProductSection from "../views/LandingPage/Sections/ProductSection.jsx";
import TeamSection from "../views/LandingPage/Sections/TeamSection.jsx";
import WorkSection from "../views/LandingPage/Sections/WorkSection.jsx";

// import Footer from "components/Footer/Footer.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import Button from "components/CustomButtons/Button.jsx";


// import landingPageStyle from "assets/jss/material-kit-react/views/landingPage.jsx";

class Landingpage extends Component {
    render() {
        const { classes, ...rest } = this.props;
        return (
            <div>
                <Header
                    color="transparent"
                    brand="Tyrify"
                    rightLinks="Login"
                    fixed
                    changeColorOnScroll={{
                        height: 200,
                        color: "white"
                    }}
                    {...rest}

                />
                <Parallax filter image={require("assets/img/landing-bg.jpg")}>
                    <div className={classes.container}>
                        <GridContainer>
                            <GridItem xs={12} sm={12} md={6}>
                                <h1 className={classes.title}>Your Story Starts With Us.</h1>
                                <h4>
                                    Every landing page needs a small description after the big
                                    bold title, that's why we added this text here. Add here all
                                    the information that can make you or your product create the
                                    first impression.
                </h4>
                                <br />
                                <Button
                                    color="danger"
                                    size="lg"
                                    href="https://www.youtube.com/watch?v=dQw4w9WgXcQ"
                                    target="_blank"
                                    rel="noopener noreferrer"
                                >
                                    <i className="fas fa-play" />
                                    Watch video
                </Button>
                            </GridItem>
                        </GridContainer>
                    </div>

                </Parallax>
                <div className={classNames(classes.main, classes.mainRaised)}>
                    <div className={classes.container}>
                        <ProductSection />
                        <TeamSection />
                        <WorkSection />
                    </div>
                </div>
            </div>

        );
    }
}

export default Landingpage;
